echart3.0有內置地图省份和国家名称，nameMap映射以后的value必须与series里面的data.name保持一致，你所说的问题就解决了。
例如以china地图为例：
data:[
  { name: 'BJ', value: 78 },
  { name: 'TJ', value: 96 }
]
nameMap:{
 北京: 'BJ',
 天津: 'TJ'
}
nameMap基础地区和国家名不区分简繁体中英文，映射以后的值需和data.name 保持一致。
