@Ericazhang1990 感谢提醒，已经解决了。在轴设置下加入axisPointer就可以item和axis同时触发。如下：
```
tooltip: {
  trigger: 'item'
},
xAxis: {
  data: [],
  axisPointer: {
    show: true,
    type: 'line',
    label: {
      show: false 
    },
    lineStyle: {
      width: 0.5
    }
  }
}
```

可以的。在tooltip的formatter中判断当前类型是不是markLine，返回不同格式就可以。
```
tooltip: {
        trigger: 'item',
        formatter: function (params) {
            if (params.componentType === 'markLine') {
                return format1;   //自定义format1
            }
            return format2; //自定义format2
        }
    },
```

I guess a workaround would be to set the label color by specifying it at the data item level. Something like:
```
options.series[0].data = valueData(data);

    function valueData(data) {
        return data.map(function(d) {
            return {
                value: [groupAccessor.raw(d)[0], groupAccessor.raw(d)[1], metricAccessor.raw(d), metricAccessor.formatted(d), d],
                label: {
                    normal: {
                        color: contrastingColor(metricAccessor.color(d))
                    }
                },
                itemStyle: {
                    normal: {
                        color: metricAccessor.color(d)
                    }
                }
            }
        });
    }

    function contrastingColor(color) {
        return (luma(color) >= 165) ? '#000' : '#fff';
    }

    // color can be a hx string or an array of RGB values 0-255
    function luma(color)  {
        var rgb = (typeof color === 'string') ? echarts.color.parse(color) : color;
        return (0.2126 * rgb[0]) + (0.7152 * rgb[1]) + (0.0722 * rgb[2]); // SMPTE C, Rec. 709 weightings
    }
```

